description:
Apparently everybody is doing it but who are THEY? A Real Swinger's Orgy pulls back the heavy velvet curtains on an underground polyamorous society that tantalizingly could contain your female doctor, your boss's wife or the young couple across the street. Featuring footage from a real swinger's party that took place in San Francisco with 80 amateur swingers and 20 porn stars get together to fuck each other's brains out but you never know who you will meet. Michael goes to the doctor for a chek up and makes small talk with her. Later that week at the party he frantically fucks a masked lady from behind only to discover to his embarrassment that he just screwed his family doctor.

